import React, { Component } from 'react';
import './App.css';
import Nav from './Nav'
import 'semantic-ui/dist/semantic.min.css';
import Img from './image/landing-page.jpg'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Nav />
        <div className="landing-img">
        <img src={Img} alt="here" />
        </div>
      </div>
    );
  }
}

export default App;
